// src/App.js
import React, { Component } from "react";

class TotalTimer extends Component {
  render() {
    const { status, runningTime } = this.props;
    return (
      <div className="">
        <h1>Stopwatch</h1>
        <Stopwatch status={false} runningTime={0} />
      </div>
    );
  }
}

function Stopwatch() {
  return (
    <div>
      <p>{runningTime}ms</p>
      <button>{status ? "Stop" : "Start"}</button>
      <button>Reset</button>
    </div>
  );
}

export default TotalTimer;
